import React from 'react'
import UserForm from './UserForm'
const SubmittedDetails = (props) => {
    function InSubmittedDetails(details) {
        return(
            <div>{details}</div>
        )
    }
  return (
    <div>
        <UserForm onSubmittedDetails={InSubmittedDetails}/>
    </div>
    
    
    
    

  )
}

export default SubmittedDetails
